(window.webpackJsonp=window.webpackJsonp||[]).push([[763],{1118:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1661-cuu-tinh-danh-su-【-canh-thu-nhat-】"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1661-cuu-tinh-danh-su-【-canh-thu-nhat-】"}},[n._v("#")]),n._v(" Chương 1661: Cửu tinh danh sư 【 canh thứ nhất 】")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1661: Cửu tinh danh sư "),t("br"),t("br"),n._v("Không phải Trương Huyền chối từ, mà là thật cái gì đều không có chuẩn bị."),t("br"),t("br"),n._v("Vốn tới đây, là muốn tìm đến Khổng sư lưu lại đột phá chi pháp, mượn cơ hội xung kích Đại Thánh cấp bậc, không nghĩ tới mới nhìn thấy Nhậm sư, liền nói muốn cho hắn khảo hạch..."),t("br"),t("br"),n._v("Đổi lại ai, đều sẽ choáng váng."),t("br"),t("br"),n._v("“Năng lực của ngươi cùng thiên phú, phụ tu chức nghiệp ta cũng chuyên môn điều tra qua, bát tinh thời điểm đều đạt tới cấp bậc Thánh Tử, khẳng định không có vấn đề, chỉ là trước thời hạn mấy ngày, cùng trì hoãn mấy ngày thông qua vấn đề thôi!”"),t("br"),t("br"),n._v("Nhậm sư cười cười."),t("br"),t("br"),n._v("Trước mắt vị này năng lực, hắn tận mắt nhìn thấy, bất luận giảng bài, bản thân tu vi vẫn là cái khác đủ loại tình huống, đều không thể kén chọn, trở thành cửu tinh danh sư đã là nhất định, hiện tại mời, không hành lễ tiết thôi!"),t("br"),t("br"),n._v("“Cái này... Cũng tốt, không biết như thế nào khảo hạch?”"),t("br"),t("br"),n._v("Đã đối phương nói như vậy, Trương Huyền cũng không có gì có thể xoắn xuýt, dừng lại một chút, nhìn lại."),t("br"),t("br"),n._v("Dù sao cửu tinh danh sư, khẳng định muốn khảo hạch."),t("br"),t("br"),n._v("Đã đối phương nhiệt tình như vậy, chọn ngày không bằng đụng ngày, vậy thì liền tùy tiện thi một chút!"),t("br"),t("br"),n._v("Chỉ là... Thế nào cảm giác, khảo hạch cửu tinh danh sư, như thế trò đùa đâu?"),t("br"),t("br"),n._v("“Bình thường cửu tinh khảo hạch, cần xác lập mới giáo dục lý luận, cũng nghĩ biện pháp chứng minh, chân thực hữu hiệu... Ngươi có thể giáo dục ra Vương Dĩnh, Trịnh Dương, Triệu Nhã đám người, nói rõ coi như không cần khảo hạch, cũng hoàn toàn hợp lệ!”"),t("br"),t("br"),n._v("Nhậm sư giải thích."),t("br"),t("br"),n._v("Cửu tinh danh sư, không chỉ sẽ giảng bài, còn muốn có thuộc về mình giáo dục lý niệm, tuy là không biết trước mắt vị này lý niệm là cái gì, nhưng có thể... Dạy ra nhiều như vậy ưu tú học sinh, loại vật này, không khảo hạch cũng rõ ràng, nhất định qua ải."),t("br"),t("br"),n._v("“Sau đó là tâm cảnh khắc độ đạt tới 27, có ba vị cửu tinh danh sư tiến cử... Những điều kiện khác đều thỏa mãn, duy nhất chính là thực lực!”"),t("br"),t("br"),n._v("“Như vậy, Vương sư, ngươi đè thấp đến Kiến Thần Bất Hoại sơ kỳ, cùng Trương sư đối đầu một quyền!”"),t("br"),t("br"),n._v("Nhậm sư dặn dò."),t("br"),t("br"),n._v("“Tốt!”"),t("br"),t("br"),n._v("Một vị gọi là Vương sư lão giả đi tới, toàn thân một hồi hoa hoa tác hưởng, tu vi đã đè thấp đến Kiến Thần Bất Hoại sơ kỳ."),t("br"),t("br"),n._v("Thực lực của hắn bản thân liền không qua Kiến Thần Bất Hoại hậu kỳ bộ dạng, giờ phút này đè thấp tu vi, không có gì khó khăn, mỉm cười, nhìn lại: “Trương sư cẩn thận, nếu là khảo hạch, ta sẽ không hạ thủ lưu tình!”"),t("br"),t("br"),n._v("“Tốt!”"),t("br"),t("br"),n._v("Thấy đối phương chuẩn bị kỹ càng, Trương Huyền chẳng muốn che giấu, một quyền công kích đi qua."),t("br"),t("br"),n._v("Vương sư cũng hét lớn một tiếng, một quyền ra tay."),t("br"),t("br"),n._v("Bành! Vèo! Ah!"),t("br"),t("br"),n._v("Vương sư không thấy tung tích."),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Đại điện phía trong tất cả danh sư tất cả đều lông mày nhảy một cái."),t("br"),t("br"),n._v("Đây thật là Thánh vực cửu trọng?"),t("br"),t("br"),n._v("Làm sao cảm giác liền xem như bọn họ, đều chống lại không được?"),t("br"),t("br"),n._v("“Vương sư không phải là đối thủ, tuy là tu vi không có đột phá Đại Thánh, nhưng thực lực đầy đủ... Lưu sư, ngươi đi chuẩn bị cửu tinh danh sư huy chương a, từ hôm nay trở đi, Trương sư chính là cửu tinh danh sư...”"),t("br"),t("br"),n._v("Nhậm sư cười gật đầu."),t("br"),t("br"),n._v("“Cái này là được?”"),t("br"),t("br"),n._v("Trương Huyền mặt mũi im lặng."),t("br"),t("br"),n._v("Có muốn hay không nhanh như vậy?"),t("br"),t("br"),n._v("Nếu không phải biết nơi này là Danh Sư đường tổng bộ, biết trước mắt vị này vì quyền đường chủ, cũng hoài nghi đến chợ bán thức ăn, tại mua củ cải."),t("br"),t("br"),n._v("Lại hoặc là gặp lừa đảo."),t("br"),t("br"),n._v("Tổng cộng đi vào đại điện không đến hai phút đồng hồ, tùy tiện đập bay người, liền thành cửu tinh danh sư..."),t("br"),t("br"),n._v("Dường như, lúc trước khảo hạch nhất tinh, cũng không có dễ dàng như vậy."),t("br"),t("br"),n._v("Xem ra sau này, thi không qua nhất tinh danh sư, có thể cân nhắc qua đến, khảo hạch cái cửu tinh..."),t("br"),t("br"),n._v("“Đã trở thành cửu tinh danh sư, có tư cách tới tham gia lần này hội nghị...”"),t("br"),n._v(" Không để ý tới hắn im lặng, Nhậm sư vẻ mặt mang theo ngưng trọng."),t("br"),t("br"),n._v("Thấy bọn họ muốn họp, Lạc Nhược Hi khẽ gật đầu: “Ta ra ngoài chờ ngươi...”"),t("br"),t("br"),n._v("Nói xong, lui ra gian phòng."),t("br"),t("br"),n._v("“Cái gì hội nghị? Gấp gáp như vậy?”"),t("br"),t("br"),n._v("Thấy nữ hài rời khỏi, Trương Huyền cũng không ngăn trở, mà là nghi ngờ nhìn về phía trước mắt Nhậm Thanh Viễn."),t("br"),t("br"),n._v("Rất hiển nhiên, hắn cũng hiểu rõ, đối phương là vì để hắn có thể tham gia hội nghị, lúc này mới thông qua nhanh như vậy, thậm chí cho người ta một loại trò đùa cảm giác."),t("br"),t("br"),n._v("“Là Dị Linh tộc nhân... Toàn diện bạo phát!”"),t("br"),t("br"),n._v("Vẻ mặt nghiêm túc, Nhậm Thanh Viễn lại hết rồi vừa rồi cử chỉ, mà là cau mày."),t("br"),t("br"),n._v("“Toàn diện bạo phát?”"),t("br"),t("br"),n._v("Sửng sốt một chút, Trương Huyền chỉ thấy một vị đã từng thấy qua cửu tinh danh sư, đi tới bên tường, chỉ vào một tấm bản đồ."),t("br"),t("br"),n._v("Vẽ là danh sư đại lục tổng thể phạm vi, phía trên lít nha lít nhít, tràn đầy điểm đỏ."),t("br"),t("br"),n._v("“Toàn bộ đại lục hết thảy có 108 cái cỡ lớn Địa quật lối ra, hiện tại, đồng thời xuất hiện rung chuyển, đều có Dị Linh tộc nhân xung kích, Chiến Sư đường cùng Danh Sư đường, cũng đã có chút thủ không được...”"),t("br"),t("br"),n._v("Vị này cửu tinh danh sư nói."),t("br"),t("br"),n._v("“108 chỗ Địa quật lối ra?” Trương Huyền sững sờ, ngay sau đó ngạc nhiên."),t("br"),t("br"),n._v("Trước hắn, mặc dù biết Địa quật lối ra nhất định không ít, nhưng không nghĩ tới nhiều như vậy."),t("br"),t("br"),n._v("Thật muốn cùng lúc tuôn ra, coi như Danh Sư đường ngồi Trấn Thiên xuống, cũng quả thực khó mà chống lại."),t("br"),t("br"),n._v("“Đến cùng chuyện gì?” Cũng nhịn không được nữa, hỏi."),t("br"),t("br"),n._v("“Cụ thể ta cũng không rõ lắm, là trước mấy ngày xuất hiện sự tình, Dị Linh tộc nhân không biết bị cái gì kích động, đại quy mô xung kích trong lòng đất chiến sư cùng Danh Sư đường trấn giữ vị trí, không ít phong ấn, cũng đã bị phá hủy... Rất nhiều danh sư bị thương!”"),t("br"),t("br"),n._v("Nhậm sư mở miệng nói."),t("br"),t("br"),n._v("“Loại này quy mô chiến đấu, trước kia phát sinh qua ư?”"),t("br"),t("br"),n._v("Trương Huyền nhịn không được hỏi."),t("br"),t("br"),n._v("“Trước kia cũng từng có, nhưng cùng lúc đại quy mô như vậy chiến đấu, còn chưa hề xuất hiện qua...” Nhậm sư lắc đầu: “Danh Sư đường, hầu như tất cả cửu tinh trở xuống cường giả, đều phái đi ra, chỉ là vẫn như cũ hạt cát trong sa mạc, không có tác dụng quá lớn, nếu như không kiên trì nổi... Trong mười ngày, phong ấn nhất định triệt để tổn hại, Dị Linh tộc nhân, sẽ toàn bộ giết tới đại lục...”"),t("br"),t("br"),n._v("“Mười ngày?”"),t("br"),t("br"),n._v("Trương Huyền nắm đấm căng thẳng."),t("br"),t("br"),n._v("Không nghĩ tới thời gian như vậy gấp gáp."),t("br"),t("br"),n._v("Dị Linh tộc nhân đây là thế nào, đột nhiên làm chuyện điên rồ?"),t("br"),t("br"),n._v("Chẳng lẽ..."),t("br"),t("br"),n._v("Cũng nhịn không được nữa, lông mày giương lên: “Có phải hay không Khổng miếu xuất hiện biến cố, lập tức liền muốn mở ra?”"),t("br"),t("br"),n._v("Loại trừ lý do này, thực sự nghĩ không ra cái gì có thể để Dị Linh tộc nhân sôi trào, như vậy không tính toán hi sinh."),t("br"),t("br"),n._v("“Khổng miếu không gian chung quanh hiện tại càng khuấy động càng lợi hại, bất cứ lúc nào cũng sẽ mở ra, đạt tới cửu tinh cấp bậc danh sư, phần lớn đều muốn tiến về trấn thủ, không thể để cho lăn lộn tới Dị Linh tộc cường giả được như ý! Vì lẽ đó, thực sự phái không ra người đến, trấn áp 108 chỗ Địa quật lối vào... Vì lẽ đó, chúng ta chính đang thương nghị, có thể hay không để Trương gia, Lạc gia, Tưởng gia, thậm chí Băng Nguyên cung, Độc điện những này vượt nhất lưu thực lực cùng nhau phái người tới, cùng nhau trấn áp?”"),t("br"),t("br"),n._v("Nhậm sư nhìn qua, ánh mắt mang theo trông đợi: “Cũng là vì nhân tộc...”"),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Trương Huyền sững sờ, giờ mới hiểu được, vì sao hắn khảo hạch cửu tinh danh sư như vậy trò đùa."),t("br"),t("br"),n._v("Thành cửu tinh danh sư, chính là Danh Sư đường một thành viên, đại lục rung chuyển, nhân tộc tùy thời đều có thể gặp tai hoạ ngập đầu, hắn cũng có không thể trốn tránh trách nhiệm!"),t("br"),t("br"),n._v("Hiển nhiên, đối phương biết hắn hiện tại tam tộc sở trường thân phận, muốn cưỡng ép đem kéo lên chiến thuyền."),t("br"),t("br"),n._v("Dù sao, tam đại gia tộc, Băng Nguyên cung, Độc điện... Cộng lại đã là một cỗ, có thể chi phối toàn bộ đại lục siêu cường thế lực."),t("br"),t("br"),n._v("Coi như Danh Sư đường, cũng không dám khinh thường."),t("br"),t("br"),n._v("Không phải, ban đầu ở liên minh đế quốc, cũng không đến mức như vậy bó cánh tay."),t("br"),t("br"),n._v("“Vì nhân tộc, đương nhiên việc nghĩa chẳng từ!” Không có suy nghĩ quá lâu, Trương Huyền vẻ mặt nghiêm túc, trong nháy mắt gật gật đầu."),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1672"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1674"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);